function reset() {
    this.get('logWindow').textString = '';
    this.get('inputLine').textString = 'ls';
    this.connections = {exec: {}, serverResult: {}, execCommands: {}}
    this.get('logWindow').connections = {exec: {}, serverResult: {}}
}

